

define([

   "dojo/_base/declare",
   "dojo/dom-class",
   "dojo/Deferred",

   "hotplate/hotDojoWidgets/ConfirmDialog",

   "./_Button",

   ], function(

     declare
     , domClass
     , Deferred

     , ConfirmDialog

     , _Button

 ){

  return declare( [ _Button ], {

    userStrategyData: null,

    constructor: function( params ){
      var self = this;

      //  Create attributes that are local to the object
      self.userStrategyData = params.userStrategyData;

    },

  });

});





